import React from "react";
import style from "./NavBar.module.css";

function NavBar() {
  return (
    <nav className={style.nav}>
      <ul>
        <a className={style.l1}>My Server</a>
        <a className={style.l2}>Recommended</a>
        <a className={style.l3}>NA Server</a>
      </ul>
    </nav>
  );
}

export default NavBar;
